	// console.debug( `COSTO -> ${comisionmeli}` );
	// console.debug( `COSTO -> ${iva}` );

	// const total1 = Number(neto) + Number(comisiontienda);
	// console.debug( `✅neto + comisiontienda = ${total1}` );
	// const total2 = Number(total1) * Number(comisionmeli);
	// console.debug( `total1 * %comisionMELI = ${total2}` );
	// const total3 = Number(total1) + Number(total2);
	// console.debug( `total1 + total2 = ${total3}` );

	const total1 = Number(neto) + Number(comisiontienda);
	console.debug( `✅neto + comisiontienda = ${total1}` );
	let total2 = (Number(total1) * Number(comisionmeli)) / 10;
	total2 = Math.ceil(total2);
	console.debug( `comision MELI = ${total2}` );
	const total3 = total1 + total2;
	console.debug( `precio cliente + comision MELI = ${total3}` );
}
